import Log from './Log';

import '../css/DynamicContentWidget.css';


module.exports = class DynamicContentWidgetContext extends Component {

    constructor( id, label, css, text )
    {
        this.id = id;
        this.label = label;
        this.css = css;
        this.text = text;
    }
}

export default class DynamicContentWidget extends Component {

